    return (
        <tr>
            {console.log(event)}
            <td className="border px-4 py-2">{event.id}</td>
            <td className="border px-4 py-2">{event.title}</td>
            <td className="border px-4 py-2">{event.body}</td>
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 border border-blue-700 rounded">削除</button>
        </tr>
    )
}
